function transformCodeBlocks(){let fragments=document.getElementsByClassName("fragment");for(let i=0;i<fragments.length;i++){let copyDataTargetId="code__"+i;let table=document.createElement("table");let tablebody=document.createElement("tbody");table.append(tablebody);let tableRow=document.createElement("tr");tablebody.append(tableRow);let lineColumn=document.createElement("td");lineColumn.classList.add("line-numbers");let linePre=document.createElement("pre");lineColumn.append(linePre);let codeColumn=document.createElement("td");let codePre=document.createElement("pre");codeColumn.append(codePre);let codeCopyBtn=document.createElement("button");codeCopyBtn.classList.add("btn-flat","copy-code-btn","tooltipped");codeCopyBtn.setAttribute("data-clipboard-target","#"+copyDataTargetId);codeCopyBtn.setAttribute("data-position","left");codeCopyBtn.setAttribute("data-tooltip","copy to clipboard");codeCopyBtn.addEventListener("mouseleave",function(event){event.target.setAttribute("data-tooltip","copy to clipboard")},false);let copyIcon=document.createElement("span");copyIcon.classList.add("material-icons");copyIcon.innerHTML="content_copy";codeCopyBtn.append(copyIcon);let codeCode=document.createElement("code");codeCode.id=copyDataTargetId;codePre.append(codeCopyBtn);codePre.append(codeCode);let lines=fragments[i].getElementsByClassName("line");let linenos=fragments[i].getElementsByClassName("lineno");if(linenos.length>0){tableRow.append(lineColumn)}tableRow.append(codeColumn);while(lines.length>0){let spanLineNumber=lines[0].querySelector("span.lineno");if(spanLineNumber){linePre.append(spanLineNumber.previousElementSibling);linePre.append(spanLineNumber);linePre.lastElementChild.classList.remove("lineno");linePre.lastElementChild.classList.add("line-number");linePre.lastElementChild.innerHTML=linePre.lastElementChild.innerHTML.trimStart();if(linePre.lastElementChild.children.length){let linkElement=linePre.lastElementChild.getElementsByClassName("line");linkElement[0].innerHTML=linkElement[0].innerHTML.trimStart()}linePre.innerHTML+="\n"}if(lines[0].innerHTML.startsWith("&nbsp;")){codeCode.innerHTML+=lines[0].innerHTML.slice(6).trimEnd()}else{codeCode.innerHTML+=lines[0].innerHTML}lines[0].remove();if(lines.length>0){codeCode.append(document.createTextNode("\n"))}}fragments[i].prepend(table)}}transformCodeBlocks();var copyClipboardHabdler=new ClipboardJS(".copy-code-btn");copyClipboardHabdler.on("success",function(e){e.clearSelection();e.trigger.setAttribute("data-tooltip","copied!");M.Tooltip.getInstance(e.trigger).open()});copyClipboardHabdler.on("error",function(e){console.error("Action:",e.action);console.error("Trigger:",e.trigger)});mybutton=document.getElementById("scroll-to-top");window.onscroll=scrollFunction;function scrollFunction(){if(document.body.scrollTop>360||document.documentElement.scrollTop>360){mybutton.style.display="block"}else{mybutton.style.display="none"}}const toggleSwitch=document.querySelector("#dark-theme-toogle");function switchTheme(e){if(e.target.checked){localStorage.setItem("theme","dark");document.documentElement.setAttribute("data-theme","dark");toggleSwitch.checked=true}else{localStorage.setItem("theme","light");document.documentElement.setAttribute("data-theme","light");toggleSwitch.checked=false}}toggleSwitch.addEventListener("change",switchTheme,false);if(document.documentElement.getAttribute("data-theme")=="dark"){toggleSwitch.checked=true}function modifySearchBar(){let divSearch=document.getElementById("MSearchBox");let right=divSearch.getElementsByClassName("right")[0];let left=divSearch.getElementsByClassName("left")[0];right.classList.replace("right","search-right");left.classList.replace("left","search-left")}modifySearchBar();function moveBreadcrumbs(){let navPath=document.getElementById("nav-path");if(!navPath){return}let navWrapper=document.createElement("nav");navWrapper.id="nav-path";navWrapper.classList.add("nav-wrapper");let breadcrumbDiv=document.createElement("div");breadcrumbDiv.classList.add("col","s12");navWrapper.append(breadcrumbDiv);let breadcrumbs=navPath.getElementsByTagName("li");for(let i=0;i<breadcrumbs.length;i++){breadcrumbDiv.innerHTML+=breadcrumbs[i].innerHTML;breadcrumbDiv.lastElementChild.classList.add("breadcrumb")}let topElement=document.getElementById("top");if(breadcrumbDiv.childElementCount>0){topElement.append(navWrapper)}navPath.remove()}moveBreadcrumbs();function replaceSearchCloseImg(){let closeLink=document.getElementById("MSearchClose");closeLink.innerHTML='<span id="MSearchCloseImg" class="material-icons">close</span>'}replaceSearchCloseImg();function revertUL(className){let textBlocks=document.getElementsByClassName(className);for(let i=0;i<textBlocks.length;i++){let unorderedLists=textBlocks[i].getElementsByTagName("ul");for(let j=0;j<unorderedLists.length;j++){unorderedLists[j].classList.add("browser-default")}}}revertUL("textblock");revertUL("memdoc");function replaceTableWithDataLists(className){let oldTables=document.querySelectorAll("table."+className);for(let i=0;i<oldTables.length;i++){let newDataList=document.createElement("dl");newDataList.classList.add(className);let tableRows=oldTables[i].getElementsByTagName("tr");for(let j=0;j<tableRows.length;j++){let rowCells=tableRows[j].getElementsByTagName("td");let paramDir="";let paramName=document.createElement("dt");let paramDesc=document.createElement("dd");for(let k=0;k<rowCells.length;k++){if(rowCells[k].classList.contains("paramdir")){paramDir=" "+rowCells[k].innerHTML}else if(rowCells[k].classList.contains("paramname")){paramName.classList.add("paramname");paramName.innerHTML=rowCells[k].innerHTML;if(paramDir.length>0){let spanParamDir=document.createElement("em");spanParamDir.classList.add("paramdir");spanParamDir.innerHTML=paramDir;paramName.append(spanParamDir)}newDataList.append(paramName)}else{paramDesc.innerHTML=rowCells[k].innerHTML;newDataList.append(paramDesc)}}}oldTables[i].replaceWith(newDataList)}}replaceTableWithDataLists("params");replaceTableWithDataLists("tparams");replaceTableWithDataLists("retval");function modifyDeclarations(){let declarationGroups=document.getElementsByClassName("memberdecls");for(let i=0;i<declarationGroups.length;i++){let rows=declarationGroups[i].getElementsByTagName("tr");let newGrid=document.createElement("div");newGrid.classList.add("memberdecls","container");let inheritedDetails=false;for(let j=0;j<rows.length;j++){let hasContent=true;let newRow=document.createElement("div");if(rows[j].classList.contains("inherit_header")){newRow=document.createElement("details");let summary=document.createElement("summary");summary.classList.add("inherit_header");let oldImg=rows[j].getElementsByTagName("img")[0];oldImg.remove();summary.innerHTML=rows[j].firstElementChild.innerHTML;if(summary.innerHTML.startsWith("&nbsp;")){summary.innerHTML=summary.innerHTML.slice(6)}newRow.append(summary);inheritedDetails=true}else{for(let k=0;k<rows[j].children.length;k++){let newCol=document.createElement("div");newCol.classList.add("col");if(rows[j].children[k].classList.contains("memItemLeft")){newCol.classList.add("s2","memItemLeft");if(!rows[j].children[k].classList.contains("mdescLeft")){newCol.innerHTML=rows[j].children[k].innerHTML}}else if(rows[j].children[k].classList.contains("memItemRight")){newCol.classList.add("s6","memItemRight");newCol.innerHTML=rows[j].children[k].innerHTML}else if(rows[j].children[k].classList.contains("mdescRight")){newCol.classList.add("s4","mdescRight");newCol.innerHTML=rows[j].children[k].innerHTML;hasContent=false;if(inheritedDetails){newGrid.lastElementChild.lastElementChild.append(newCol)}else{newGrid.lastElementChild.append(newCol)}}else if(!(rows[j].children[k].classList.contains("memSeparator")||rows[j].children[k].classList.contains("mdescLeft"))){for(let ch=0;ch<rows[j].children[k].classList.length;ch++){newCol.classList.add(rows[j].children[k].classList[ch])}newCol.innerHTML=rows[j].children[k].innerHTML;newCol.classList.add("s12");if(newCol.firstElementChild.classList.contains("groupText")||newCol.classList.contains("ititle")){hasContent=false;newGrid.lastElementChild.append(newCol)}}else{hasContent=false}if(hasContent){newRow.append(newCol)}}}newRow.classList.add("row");if(hasContent){if(inheritedDetails&&!rows[j].classList.contains("inherit_header")){newGrid.lastElementChild.append(newRow)}else{newGrid.append(newRow)}}}declarationGroups[i].replaceWith(newGrid)}}modifyDeclarations();function extractLabels(parentElement){let memberPrototypes=parentElement.querySelectorAll(".mlabel");if(memberPrototypes.length>0){let actualPrototype=parentElement.querySelector("table.memname");let containerTable=parentElement.querySelector("table.mlabels");containerTable.replaceWith(actualPrototype);return memberPrototypes}return null}function adaptMemberTitle(){let memTitles=document.querySelectorAll("h2.memtitle");for(let i=0;i<memTitles.length;i++){let iconLink=document.createElement("a");iconLink.innerHTML="link";iconLink.classList.add("material-icons");let newTitle=document.createElement("h3");newTitle.classList.add("memtitle");for(let j=0;j<memTitles[i].children.length;j++){if(memTitles[i].children[j].classList.contains("permalink")){iconLink.classList.add("permalink");iconLink.href=memTitles[i].children[j].children[0].href;memTitles[i].removeChild(memTitles[i].children[j])}}newTitle.innerHTML=memTitles[i].innerHTML;newTitle.append(iconLink);memTitles[i].replaceWith(newTitle);let badges=extractLabels(newTitle.nextElementSibling);if(badges){for(let j=0;j<badges.length;j++){newTitle.append(badges[j])}}}}adaptMemberTitle();